INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256221282535', 'Assortiments de mini tartelettes apéritif', '6 mini-tartelettes façon quiche lorraine 26,2% : Garniture 51,9% [eau, OEUF entier liquide, lardon cuit fumé 6,4%* (poitrine de porc (France), sel, dextrose, arôme de fumée, correcteur d\'acidité : acide citrique, antioxydant : érythorbate de sodium, conservateur : nitrite de sodium), jambon fumé cuit standard goût fumé 6,4%* (jambon de porc (Union Européenne), eau, protéines de sang, sel, dextrose, sirop de glucose, stabilisants : diphosphates et triphosphates, arômes dont arôme de fumée, gélifiants : carraghénanes - farine de graines de caroube - gomme xanthane, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), LAIT écrémé en poudre, amidon transformé de pomme de terre, arômes (LAIT et céréales contenant du GLUTEN), sel], pâte brisée** 48,1%.*Pourcentages exprimés sur la tartelette.6 mini-tartelettes aux champignons 24,6% : Pâte brisée** 51,4%, garniture 48,6% [eau, mélange de champignons 13,1%* (bolets, cèpes, pholiotes, shiitakés, lactaires), OEUF entier liquide, EMMENTAL râpé, préparation déshydratée pour sauce (LACTOSERUM, amidon transformé de pomme de terre, LAIT entier en poudre, sel, épaississant : gomme xanthane, poivre noir, muscade), amidon transformé de pomme de terre, crème (CREME, stabilisant : carraghénanes), oignon, ail, sel, persil, poivre noir]. *Pourcentages exprimés sur la tartelette.6 mini-tartelettes au poireau et au saumon 24,6% : Pâte brisée** 51,4%, garniture 48,6% [eau, OEUF entier liquide, poireau 8,8%*, SAUMON fumé 4,8%* (SAUMON Salmo salar 4,7%*, sel), crème (CREME, stabilisant : carraghénanes), préparation déshydratée pour sauce (LACTOSERUM, amidon transformé de pomme de terre, LAIT entier en poudre, sel, épaississant : gomme xanthane, poivre noir, muscade), miettes de saumon cuit 1,7%* (SAUMON Salmo salar 1,6%*, sel), amidon transformé de pomme de terre, préparation à base de jus concentré de citron jaune et de pulpe de citron jaune (jus concentré de citron jaune, correcteur d\'acidité : acide citrique, eau, pulpe de citron jaune, sucre, citron jaune), ciboulette, sel, poivre noir.*Pourcentages exprimés sur la tartelette.6 mini-tartelettes aux deux fromages 24,6% : Pâte brisée** 51,4%, garniture 48,6% [eau, EMMENTAL râpé 12,7%*, OEUF entier liquide, LAIT écrémé en poudre, amidon transformé de pomme de terre, PARMESAN râpé 0,9%*, sel, arôme]. *Pourcentages exprimés sur la tartelette.**Pâte brisée : farine de BLE, huile de tournesol, eau, BEURRE, amidon de BLE, sel, LACTOSERUM et protéines de LAIT, sucre, poudres à lever : diphosphates et carbonates de sodium (céréales contenant du GLUTEN). Traces éventuelles de moutarde, céleri, mollusques, crustacés, fruits à coque et soja.', 'https://static.openfoodfacts.org/images/products/325/622/128/2535/front_fr.27.400.jpg', '20.9', '5', '40.8', '2.6', '1.5', '10.6', '1.13', '0.444881889763779', '', '0');

