INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256221828580', 'Bûchettes Glacées, saveurs vanille-crème brûlée, framboise, chocolat', '2 Bûchettes sorbet à la framboise et crème glacée à la vanille avec en décor des micro-copeaux de chocolat noir.  Sorbet à la framboise 56% : eau, purée de framboise 35%*, sucre, jus concentré de sureau, jus concentré de citron, gélifiants : gomme tara — pectines - gomme xanthane, colorant: rouge de betterave, protéines de pois hydrolysées, arôme naturel. *% exprimé sur le sorbet à la framboise. Crème glacée à la vanille 43,1% : lait écrémé réhydraté, eau, sucre, crème, poudre de lactosérum, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube - gomme guar, arôme naturel de vanille. Micro—copeaux de chocolat noir 0,9% : pâte de cacao, sucre, beurre de cacao, beurre concentré, émulsifiant : lécithine de soja, extrait de vanille.  2 Bûchettes crèmes glacées au chocolat noir et à la vanille avec en décor des micro-copeaux de chocolat noir. Crème glacée au chocolat noir 54,7% : lait écrémé réhydraté, eau, crème, sucre, chocolat noir 6%* (pâte de cacao, sucre, cacao maigre en poudre, émulsifiant : lécithine de soja, arôme naturel de vanille), poudre de cacao, poudre de lactosérum, pâte de cacao, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube — gomme guar, poudre de cacao maigre.*(% exprimé sur la crème glacée au chocolat noir) Crème glacée à la vanille 44,4% : lait écrémé réhydraté, eau, sucre, crème, poudre de lactosérum, émulsifiant: mono— et diglycérides d’acides gras, gélifiants : farine de graines de caroube — gomme guar, arôme naturel de vanille. Micro—copeaux de chocolat noir 0,9%*: pâte de cacao, sucre, beurre de cacao, beurre concentré, émulsifiant : lécithine de soja, extrait de vanille. 2 Bûchettes crèmes glacées saveur crème brûlée et à la vanille avec en décor des micro copeaux de chocolat noir. Crème glacée saveur crème brûlée 54.7% : eau, sirop de glucose—fructose, crème, lait écrémé réhydraté, sucre, poudre de lactosérum, arôme naturel, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube - gomme guar, colorants : rocou — curcumine. Crèm glacée à la vanille 44,4% : lait écrémé réhydraté, eau, sucre, crème, poudre de lactosérum, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube — gomme guar, arôme naturel de vanille.   Micro-copeaux de chocolat noir 0,9% : pâte de cacao, sucre, beurre de cacao, beurre concentré, émulsifiant : lécithine de soja, extrait de vanille.  ', 'https://static.openfoodfacts.org/images/products/325/622/182/8580/front_fr.6.400.jpg', '5.7', '3.8', '23.9', '22.3', '0.2', '1.9', '0.130048', '0.0512', '', '1');

