VALUES ('3256222656779', 'Nems aux crevettes x4 + sauce nuoc mam', 'Nem aux crevettes : eau, préparation alimentaire à base de pois réhydratée (eau, préparation alimentaire à base de pois déshydratée), carotte, farine de riz 10%, oignon, pousse de haricot mungo, crevette décortiquée 8% [CREVETTE (Acetes spp ou Heterocarpus spp ou Metapenaeus spp ou Parapenaeus spp ou Parapenaeopsis spp ou Penaeus spp ou Solenocera spp ou Stylifera cp, pêchée en Océan Indien ouest ou en Océan Indien est), eau, sel], chair hachée de COLIN d\'Alaska 8% (Theragra chalcogramma, pêché en Pacifique nord-est ou Pacifique nord-ouest), protéines de SOJA, champignon noir réhydraté (eau, champignon noir déshydraté), huile de tournesol, sauce soja (eau, graine de SOJA, sel, farine de BLE), persil, sel, caramel (sucre, eau), émulsifiant : lécithine de SOJA, arôme naturel. Huile de friture : huile de tournesol. Soit 73% de garniture et 27% de galette de riz dans le nem aux crevettes. Pourcentages exprimés sur le nem aux crevettes. Sauce au nuoc mâm : eau, sucre, sel, vinaigre d\'alcool, nuoc mâm 3% (POISSON, sel, eau), sauce soja (eau, graines de SOJA, sel, farine de BLE).Pourcentage exprimé sur la sauce au nuoc mâm. Traces éventuelles de céleri, fruits à coque, graines de sésame, lait, lupin, mollusques, moutarde et oeufs.', 'https://static.openfoodfacts.org/images/products/325/622/265/6779/front_fr.34.400.jpg', '5.9', '0.7', '16', '1.7', '3.3', '8.2', '1.1', '0.433070866141732', '', '0');

